  assemblies:
  - dotPDFium
  namespace: nebulae.dotPDFium.Native
  summary: Represents the types of unsupported features that may be encountered in a PDF document.
  remarks: >-
    This enumeration categorizes various unsupported features in PDF documents, such as specific
        document-level features (e.g., XFA forms, security settings) or annotation types (e.g., 3D annotations, multimedia
        content). These values can be used to identify and handle unsupported features when processing PDF files.
  example: []
